import React from 'react';

const Header = ({ ticketCounts, toggleLiveMode, liveMode }) => {
  return (
    function Header() {
        return (
          <div className="flex justify-between items-center bg-blue-600 text-white p-4 shadow-md">
            <h1 className="text-2xl font-bold">Kanban Dashboard</h1>
            <div className="flex items-center space-x-4">
              <span className="font-semibold">Live Mode:</span>
              <label className="relative inline-flex items-center cursor-pointer">
                <input type="checkbox" className="sr-only peer" />
                <div className="w-11 h-6 bg-gray-300 peer-focus:outline-none rounded-full peer peer-checked:bg-green-500"></div>
              </label>
            </div>
          </div>
        );
      }

  );
};

export default Header;
